        junit.framework.Assert.assertEquals("[\"ROCK\",\"PAPER\",\"SCISSORS\"]", gson.toJson(java.util.EnumSet.allOf(com.google.gson.functional.EnumTest_testEnumSubclass_1000.Roshambo.class)));
